var $ = jQuery.noConflict();
var HaLim = {
    Init: function() {
        this.AjaxSearch();
        this.Actions();
    },
    GetPostByWidgetType: function(widget_type, layout, showpost, sortby, widget_id) {
        $.ajax({
            type: 'POST',
            url: halim.ajax_url,
            data: {
                action: 'halim_get_post_by_categories_widget',
                showpost, type: widget_type, layout, sortby
            },
            beforeSend: () => $(`.halim-${widget_type}-widget-${widget_id} .halim-ajax-popular-post-loading`).removeClass('hidden'),
            success: data => {
                $(`#ajax-${widget_type}-widget-${widget_id}`).html(data);
                $(`.halim-${widget_type}-widget-${widget_id} .halim-ajax-popular-post-loading`).addClass('hidden');
                $('.icon_overlay[data-toggle="halim-popover"]').popover({placement: 'top', container: 'body'});
            },
            error: () => {
                $(`#ajax-${widget_type}-widget-${widget_id}`).html('Apparently, there are no posts to show!');
                $(`.halim-${widget_type}-widget-${widget_id} .halim-ajax-popular-post-loading`).addClass('hidden');
            }
        });
    },
    Actions: function() {
        $('.icon_overlay[data-toggle="halim-popover"]').popover({container: 'body', trigger: 'hover'});
        $('.episode-pagination a[data-toggle="tab"]').on('shown.bs.tab', e => {
            const server = $(e.target).data('server');
            $('[role="tabpanel"].active .eid-'+server+'-1').click();
        });
        if ($('body.single-post').length) {
            const post_id = halim_cfg.post_id;
            const storage_key = `viewed_post_${post_id}`;
            if (!localStorage.getItem(storage_key)) {
                $.ajax({
                    type: 'POST',
                    url: '/wp-content/themes/halimmovies-child/hh3d-ajax.php',
                    dataType: 'json',
                    data: {action: 'update_post_view_count', post_id},
                    success: res => {
                        $('.luotxem span').html(res.view);
                        localStorage.setItem(storage_key, '1');
                    }
                });
            }
        }
        $(document).on('click', '.clickable, .letter-item', function() {
            window.location.href = $(this).data('href');
        });
        $(".schedule li").on('click', function() {
            $('.schedule li, #moviesLatest').removeClass('active');
            $(this).addClass('active');
            const id = $(this).data('id');
            if (!id) return;
            $.ajax({
                type: 'POST',
                url: halim.ajax_url,
                data: {action: 'halim_schedule_post', date: id},
                beforeSend: () => $('.halim-schedule-box .halim-ajax-popular-post-loading').removeClass('hidden'),
                success: data => $('.halim-schedule-box').html(data)
            });
        });
        $('#pull').on('click', e => {
            e.preventDefault();
            $('.menu').slideToggle();
        });
        if (window.matchMedia('(max-width: 1024px)').matches || is_Mobile()) {
            $('#search-form-pc').prependTo('#mobile-search-form');
            $('#pc-user-login').prependTo('#mobile-user-login');
            $('#get-bookmark, .bookmark-list-on-pc, .ui-autocomplete').remove();
            $('.halim-search-form').removeClass('hidden-xs');
            $('<div id="bookmark-list" class="hidden"><ul style="margin:0;"></ul></div>').insertAfter('#user-info');
            $('<ul class="ui-autocomplete ajax-results hidden"></ul>').insertBefore('#user-info');
            if ($('body').hasClass('logged-in')) {
                $('#pc-user-logged-in').prependTo('#mobile-user-login');
            }
        }
        let lastScroll = 64;
        $(window).on('scroll', function() {
            const st = $(this).scrollTop();
            const headerTop = $('#header').height();
            const st_check = $('body.single-post').length ? 600 : 64;
            $('.navbar-container').toggleClass('navbar-fixed-top', st > st_check);
            if (st >= headerTop) {
                $('.navbar-container').toggleClass('heads-up', st > lastScroll);
                lastScroll = st;
            }
            $("#easy-top").fadeToggle(400, () => st > 600);
        });
        $("#easy-top").on('click', () => $("html, body").animate({scrollTop: 0}, 1200));
        $('[data-toggle="tooltip"]').tooltip();
        if (!is_Mobile() && $('.halim-navbar').data('dropdown-hover') == 1) {
            $('ul.nav li.dropdown').hover(
                function() { $(this).find('.dropdown-menu').stop(true, true).delay(150).fadeIn(100); },
                function() { $(this).find('.dropdown-menu').stop(true, true).delay(150).fadeOut(100); }
            );
        }
        $(".show-more").on('click', function() {
            const $parent = $(this).parent();
            $parent.parent().find(".item-content").toggleClass("toggled");
            $parent.find(".item-content-gradient").toggleClass("hidden");
            if ($(this).data('single')) {
                $(this).text($(this).text() === $(this).data('showmore') ? $(this).data('showless') : $(this).data('showmore'));
            } else {
                $(this).toggleClass($(this).data('icon') === 'hl-angle-down' ? 'hl-angle-up' : 'hl-angle-down');
            }
        });
        $('.halim-search-form input[name="s"]').on("input", function() {
            const $this = $(this);
            $this.val($this.val()
                .replace(/à|á|ạ|ả|ã|â|ầ|ất|ậ|ẩ|ẫ|ă|ằ|ắ|ặ|ẳ|ẵ/g, "a")
                .replace(/è|é|ẹ|ẻ|ẽ|ê|ề|ế|ệ|ể|ễ/g, "e")
                .replace(/ì|í|ị|ỉ|ĩ/g, "i")
                .replace(/ò|ó|ọ|ỏ|õ|ô|ồ|ố|ộ|ổ|ỗ|ơ|ờ|ớ|ợ|ở|ỡ/g, "o")
                .replace(/ù|ú|ụ|ủ|ũ|ư|ừ|ứ|ự|ử|ữ/g, "u")
                .replace(/ỳ|ý|ỵ|ỷ|ỹ/g, "y")
                .replace(/đ/g, "d"));
            $(".hl-spin4").toggleClass('hidden', !$this.val());
        });
        $('#search-form').on('shown.bs.collapse', () => $('#search').focus());
    },
    AjaxSearch: function() {
        if (!halim?.ajax_live_search) return;
        $('#search').on({
            blur: () => setTimeout(() => $('.ajax-results').fadeOut(), 300),
            keyup: function() {
                const $this = $(this);
                const searchValue = $this.val().trim();
                if (searchValue.length < 2) {
                    $('.ajax-results').toggleClass('hidden', searchValue.length > 0);
                    return;
                }
                clearTimeout($this.data('thread'));
                $this.data('thread', setTimeout(() => {
                    $.ajax({
                        type: 'GET',
                        url: '/wp-json/halim/v1/search',
                        dataType: 'html',
                        data: {search: searchValue},
                        beforeSend: () => $('.hl-spin4').removeClass('hidden'),
                        success: result => {
                            $(".ajax-results").removeClass('hidden').html(result).show();
                            $('.hl-spin4').addClass('hidden');
                        },
                        error: () => {
                            $(".ajax-results").removeClass('hidden');
                            $('.hl-spin4').addClass('hidden');
                        }
                    });
                }, 200));
            }
        });
    },
    ReportError: function(sv, ep) {
        $.ajax({
            type: 'POST',
            url: ajax_player.url,
            data: {
                action: 'halim_report',
                id_post: halim_cfg.post_id,
                server: sv,
                episode: ep,
                post_name: $('h1.entry-title').text() + ' server ' + sv,
                halim_error_url: encodeURI(window.location),
                content: 'Auto report',
                name: 'BOT'
            }
        });
    }
};
$(document).ready(() => HaLim.Init());
